import NavBarRHome from "../navbars/NavBarHome";
import '../css/Home.css';


function Home() {



    return (

        <div className="container">
            <NavBarRHome />
            <header>

                <h1 className="h1">
                    Welcome to Car Rental System</h1>
            </header>
            

            <div className="container float-right">
            <footer>
                <h5>Hassel free ,affordable commute.Rent electric scooters & bikes</h5>
               </footer>

            </div>
        </div>

    )

}
export default Home;
